import React, { useState, useEffect } from 'react'

const WeatherTypes = {
  'clear': '☀️',
  'pcloudy': '🌤️',
  'mcloudy': '🌥️',
  'cloudy': '⛅️',
  'humid': '🌤️',
  'lightrain': '🌧️',
  'oshower': '🌦️',
  'ishower': '🌦️',
  'lightsnow': '🌨️',
  'rain': '🌧️',
  'snow': '🌨️',
  'rainsnow': '🌧️',

}

const DayWeather = ({weatherType}) => {
  const [weatherData, setWeatherData] = useState({
    weather: 'clear',
    icon: '☀️'
})

  useEffect(() => {
    setWeatherData(() => ({
        weather: weatherType,
        icon: WeatherTypes[weatherType]
    }));
  }, [weatherType])

  return (
    <div>
        <div>{weatherData.weather}</div>
        <div>{weatherData.icon}</div>
    </div>
  )
}

export default DayWeather
